import { EventActionTypes } from './event.action';
const initialState = {
  events: [],
  loaded: false,
  error: ''
};
export function EventReducer(state = initialState, action) {
  switch (action.type) {
    case EventActionTypes.LoadSuccess:
      return { ...state,
        events: [...action.payload],
        loaded: true,
        error: ''
      };

    default:
      return state;
  }
}
